import React from "react";
import {
  EnvironmentFilled,
  PhoneFilled,
  MailFilled,
  FacebookFilled,
  SkypeFilled,
  InstagramFilled,
  LinkedinFilled,
  TwitterSquareFilled,
} from '@ant-design/icons';


export const contantUs = [
  {
    img: <EnvironmentFilled />,
    text: 'Москва, ул. Горбунова, 2, стр. 3',
    link: 'https://www.google.by/maps/place/%D0%93%D0%BE%D1%80%D0%B1%D1%83%D0%BD%D0%BE%D0%B2%D0%B0+y%D0%BB%D0%B8%D1%86%D0%B0,+2+%D1%81%D1%82%D1%80%D0%BE%D0%B5%D0%BD%D0%B8%D0%B5+3,+%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0,+%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F,+121596/@55.724961,37.3949725,507m/data=!3m2!1e3!4b1!4m5!3m4!1s0x46b54efb05106725:0x17b58028799d7259!8m2!3d55.724961!4d37.3971612?hl=ru',
  },
  {
    img: <PhoneFilled />,
    text: '+7 (906) 773 30 44',
    link: 'tel:+7 (906) 773 30 44',
  },
  {
    img: <MailFilled />,
    text: 'info@edmed.com',
    link: 'mailto:info@edmed.com',
  },
];

export const navigationArr = [
  { text: 'Link 1', link: '' },
  { text: 'Link 2', link: '' },
  { text: 'Link 3', link: '' },
  { text: 'Link 4', link: '' },
  { text: 'Link 5', link: '' },
];

export const networks = [
  { img: <FacebookFilled />, text: 'Facebook', link: '' },
  { img: <SkypeFilled />, text: 'Skype', link: '' },
  { img: <InstagramFilled />, text: 'Instagram', link: '' },
  { img: <LinkedinFilled />, text: 'LinkedIn', link: '' },
  { img: <TwitterSquareFilled />, text: 'Twitter', link: '' },
];

export const forSpeakers = [
  { text: 'Договор оферты', link: '#' },
  { text: 'Методические материалы', link: '#' },
  { text: 'Рекомендации по видео', link: '#' },
];

export const forListeners = [
  { text: 'Часто задаваемые вопросы', link: '#' },
  { text: 'Пользовательское соглашение', link: '#' },
  { text: 'Подписаться на рассылку', link: '#', type: 'colored' },
];

export const information = [];
